import { useSelector } from 'react-redux';

function Header() {
  const state = useSelector((state) => state);
  console.log('Header ', state.loggedin.Username);
  return (
    <div className="jumbotron p-3 mb-0 rounded-0 bg-light ">
      <img
        src={'vrukshaGajananLogo.png'}
        style={{ width: '100px', height: '100px' }}
        className="float-left"
      />
      
      <h3 style={{ fontSize: '60px' ,color: '#7fa629' }} className=" font_design text-left font-weight-bold" >
         Vruksha Gajanan
      </h3>
      {/* <div className="clearfix"></div> */}
    </div>
  );
}

export default Header;
